import React from 'react'
import Slideer from './Slideer/Slideer'

const Home = ({slider}) => {
  const {title,description,image}=slider;
  return (
    <div>
        <Slideer/>
       <div>
       title: {title}
        {description}
        {image}
       </div>
    </div>
  )
}

export default Home
